package com.purushoth.day5;

import java.util.TreeSet;

public class TreeSetAddString {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
       TreeSet<String> set=new TreeSet<String>();
		
		set.add("Shaji");//To add elements.
		set.add("Jenish");
		set.add("Purushoth");
		set.add("Muthu");
		set.add("Sara");
		set.add("Domnic");
		
		System.out.println(set);//Elements are listed in alphabetical order.

	}//To add string in treeset

}
